import React from "react";
import { Link } from "react-router-dom";

const HomePage = () => {
  return (
    <div>
      <nav className="navbar">
        <Link to="#" className="navbar-brand">
          Thane Engen
        </Link>
      </nav>
      <h1>Home Page</h1>
    </div>
  );
};

export default HomePage;
